import React, { useEffect, useState } from 'react';
import { Table, TableHead, TableBody, TableRow, TableCell, TableContainer } from '@material-ui/core'

const App = () => {
  const [data, setData] = useState()

  useEffect(async () => {
    fetch("https://api.rootnet.in/covid19-in/contacts")
      .then(res => res.json())
      .then(res => setData({ data: res }))

    return (
      <>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>State Name</TableCell>
              <TableCell>Helpline Number</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.regional.map((row) => (
              <TableRow key={row.loc}>
                <TableCell>{row.number}</TableCell>
              </TableRow>
            ))}

          </TableBody>
        </Table>
      </>
    );
  }, [])

}

export default App;
